import React from 'react';
import { List } from 'semantic-ui-react'

export const Card = ({ listOfStocks })=> {
  return (
    <>
      <List>
        {listOfStocks.map(stocks => (<List.Item>{stocks}</List.Item>))}
      </List>
    </>
  )
}
